headerButton.customFunction:
var data = [];
var simplyfyData = [];
var temp = [];
var dateTimeHead = ["Date & Time"];


function convertTimestamptoTime(data) {
    let dateObj = new Date(data); // Assuming 'data' is in milliseconds

    let todayDate = dateObj.getDate().toString().padStart(2, '0');  
    let month = (dateObj.getMonth() + 1).toString().padStart(2, '0');  
    let year = dateObj.getFullYear();
    let hours = dateObj.getHours().toString().padStart(2, '0');  
    let minutes = dateObj.getMinutes().toString().padStart(2, '0'); 
    let seconds = dateObj.getSeconds().toString().padStart(2, '0');  

    let formattedTime = `${year}-${month}-${todayDate} ${hours}:${minutes}:${seconds}`;
    return formattedTime;
}


for (var i = 0; i < widgetContext.data.length; i++) {
  data.push(widgetContext.data[i].dataKey.label);
  simplyfyData.push(widgetContext.data[i].data);
}


temp.push(dateTimeHead.concat(data));


for (let j = 0; j < simplyfyData[0].length; j++) {
  let row = [];


  let timestamp = simplyfyData[0][j][0];
  let currTime = convertTimestamptoTime(timestamp);



  row.push(currTime);


  for (let i = 0; i < simplyfyData.length; i++) {
    row.push(simplyfyData[i][j] ? simplyfyData[i][j][1] : '');
  }


  temp.push(row);
}


const ws = XLSX.utils.aoa_to_sheet(temp);


const wb = XLSX.utils.book_new();
XLSX.utils.book_append_sheet(wb, ws, 'Sheet1');


XLSX.writeFile(wb, 'LCA Timeseries Data.xlsx');

